import { StyleSheet, Text, View, Button } from "react-native";
import React from "react";
import { SafeArea } from "../../../components/utility/safe-area.component";

const SettingsScreen = ({ navigation }) => {
  const handleMyProfilePress = () => {
    // Navigate to the "My Profile" screen
    navigation.navigate("MyProfile");
  };

  const handleSignOutPress = () => {
    // Sign out the user
  };

  const handleEditProfilePress = () => {
    // Navigate to the "Edit Profile" screen
    navigation.navigate("AddProfilePicture");
  };

  return (
    <SafeArea>
      <View>
        <Button title="My Profile" onPress={handleMyProfilePress} />
        <Button title="Add Profile Picture" onPress={handleEditProfilePress} />
        <Button title="Sign Out" onPress={handleSignOutPress} />
        <Button title="Complete Profile" onPress={()=>navigation.navigate("CompleteProfile")} />
      </View>
    </SafeArea>
  );
};

export default SettingsScreen;

const styles = StyleSheet.create({});
